highp vec3 inverse_HLG(highp vec3 rgb) {
  const highp float B67_a = 0.17883277;
  const highp float B67_b = 0.28466892;
  const highp float B67_c = 0.55991073;
  if (rgb.x <= 0.5) rgb.x=(rgb.x * 2.0) * (rgb.x * 2.0);
  else rgb.x = exp((rgb.x - B67_c) / B67_a) + B67_b;
  if (rgb.y <= 0.5) rgb.y=(rgb.y * 2.0) * (rgb.y * 2.0);
  else rgb.y = exp((rgb.y - B67_c) / B67_a) + B67_b;
  if (rgb.z <= 0.5) rgb.z=(rgb.z * 2.0) * (rgb.z * 2.0);
  else rgb.z = exp((rgb.z - B67_c) / B67_a) + B67_b;
  return rgb;
}

