highp vec3 LinearToPQ(highp vec3 rgb, highp float divider) {
  const highp float ST2084_m1 =  2610.0 / (4096.0 * 4.0);
  const highp float ST2084_m2 = (2523.0 / 4096.0) * 128.0;
  const highp float ST2084_c1 =  3424.0 / 4096.0;
  const highp float ST2084_c2 = (2413.0 / 4096.0) * 32.0;
  const highp float ST2084_c3 = (2392.0 / 4096.0) * 32.0;
  rgb /= divider;
  rgb = pow(rgb, vec3(ST2084_m1));
  rgb = (ST2084_c1 + ST2084_c2 * rgb) / (1.0 + ST2084_c3 * rgb);
  return rgb = pow(rgb, vec3(ST2084_m2));
}

