vec3 debanding() {
  vec3 rgb_origin = sample(tc).rgb;
  vec3 rgb_l1 = sample(texBlurShift_l1).rgb;
  vec3 rgb_l2 = sample(texBlurShift_l2).rgb;
  vec3 rgb_r1 = sample(texBlurShift_r1).rgb;
  vec3 rgb_r2 = sample(texBlurShift_r2).rgb;
  vec3 rgb_u1 = sample(texBlurShift_u1).rgb;
  vec3 rgb_u2 = sample(texBlurShift_u2).rgb;
  vec3 rgb_d1 = sample(texBlurShift_d1).rgb;
  vec3 rgb_d2 = sample(texBlurShift_d2).rgb;
  float y_origin = clamp(rgb_origin.r * 0.2627 + rgb_origin.g * 0.678 + rgb_origin.b * 0.0593, 0.0, 1.0); 
  float y_l1 = clamp(rgb_l1.r * 0.2627 + rgb_l1.g * 0.678 + rgb_l1.b * 0.0593, 0.0, 1.0); 
  float y_l2 = clamp(rgb_l2.r * 0.2627 + rgb_l2.g * 0.678 + rgb_l2.b * 0.0593, 0.0, 1.0); 
  float y_r1 = clamp(rgb_r1.r * 0.2627 + rgb_r1.g * 0.678 + rgb_r1.b * 0.0593, 0.0, 1.0); 
  float y_r2 = clamp(rgb_r2.r * 0.2627 + rgb_r2.g * 0.678 + rgb_r2.b * 0.0593, 0.0, 1.0); 
  float y_u1 = clamp(rgb_u1.r * 0.2627 + rgb_u1.g * 0.678 + rgb_u1.b * 0.0593, 0.0, 1.0); 
  float y_u2 = clamp(rgb_u2.r * 0.2627 + rgb_u2.g * 0.678 + rgb_u2.b * 0.0593, 0.0, 1.0); 
  float y_d1 = clamp(rgb_d1.r * 0.2627 + rgb_d1.g * 0.678 + rgb_d1.b * 0.0593, 0.0, 1.0); 
  float y_d2 = clamp(rgb_d2.r * 0.2627 + rgb_d2.g * 0.678 + rgb_d2.b * 0.0593, 0.0, 1.0); 
  float y_temp = y_origin - 1.0 / 255.0; 
  float y_delta = 2.0 * (oetf_hlg(y_origin) - oetf_hlg(y_temp)); 
  float diff_l1 = abs(y_origin - y_l1); 
  float diff_l2 = abs(y_origin - y_l2); 
  float diff_r1 = abs(y_origin - y_r1); 
  float diff_r2 = abs(y_origin - y_r2); 
  float diff_u1 = abs(y_origin - y_u1); 
  float diff_u2 = abs(y_origin - y_u2); 
  float diff_d1 = abs(y_origin - y_d1); 
  float diff_d2 = abs(y_origin - y_d2); 
  float is_less_than_delta = step(y_delta, max(max(max(max(max(max(max(diff_l1, diff_l2), diff_r1), diff_r2), diff_u1), diff_u2), diff_d1), diff_d2)); 
  highp vec3 sum = rgb_origin; 
  sum += rgb_l1; 
  sum += rgb_r1; 
  sum += rgb_u1; 
  sum += rgb_d1; 
  vec3 rgbOut = mix(rgb_origin, sum * 0.2, 1.0 - is_less_than_delta); 
  return rgbOut; 
}

